import { makeStyles } from '@material-ui/core/styles';

const HeaderStyle = makeStyles((theme) => ({
    bar: {
        backgroundColor: '#F5F5F5',
    },
    divider: {
        marginTop: theme.spacing(1),
    },
}));

export default HeaderStyle;
